import React from 'react';
import { NavLink } from 'react-router-dom';
import './Header.css';

function Header({ darkMode, toggleDarkMode }) {
  return (
    <header>
      <div className="container">
        <nav>
          <h1 className="logo"><span className="material-icons">computer</span> IT Solutions Architect</h1>
          <ul>
            <li><NavLink to="/" end><span className="material-icons">home</span> Home</NavLink></li>
            <li><NavLink to="/services"><span className="material-icons">build</span> Services</NavLink></li>
            <li><NavLink to="/about"><span className="material-icons">info</span> About</NavLink></li>
            <li><NavLink to="/contact"><span className="material-icons">email</span> Contact</NavLink></li>
            <li>
              <button onClick={toggleDarkMode} className="dark-mode-toggle">
                <span className="material-icons">{darkMode ? 'light_mode' : 'dark_mode'}</span>
              </button>
            </li>
          </ul>
        </nav>
      </div>
    </header>
  );
}

export default Header;
